public void enableDisablePriceDateButton(boolean    _isPriceType,
                                         boolean    _isDateType,
                                         boolean    _otherType)
{
    if (_otherType)
    {
        ApplyPriceFormula.enabled(false);
        ApplyDateFormula.enabled(false);
    }
    else
    {
        ApplyPriceFormula.enabled(_isPriceType);
        ApplyDateFormula.enabled(_isDateType);
    }
}

