public void pasteColumns(Set columnsToPaste)
{
    RetailMassUpdateWorksheetLine lineToCopy;
    RetailMassUpdateWorksheetLine lineToUpdate;
    SetEnumerator   se;

    lineToCopy = RetailMassUpdateWorksheetLine_ds.getFirst();

    if (lineToCopy)
    {
        lineToUpdate = RetailMassUpdateWorksheetLine_ds.getNext();
        while (lineToUpdate)
        {
            se = columnsToPaste.getEnumerator();
            while (se.moveNext())
            {
                lineToUpdate.(se.current()) = lineToCopy.(se.current());
            }
            lineToUpdate.write();

            lineToUpdate = RetailMassUpdateWorksheetLine_ds.getNext();
        }
    }

    RetailMassUpdateWorksheetLine_ds.research();
}

public void refresh()
