public void updateWorksheetFields()
{
    RetailMassUpdateSelectedProperty    selected;
    RetailMassUpdateProductProperty     property;
    RetailMassUpdateProductFastTab      fastTab;
    FieldId                             id, origFieldId;
    SetEnumerator                       se;
    boolean                             allowEditCreateDS = retailMassUpdateWorksheetTable.Status != RetailMassUpdateStatus::Posted ? true : false ;
    int                                 destinationTableNum;

    // set the worksheet header and line if the worksheet is posted.
    retailMassUpdateWorksheetTable_ds.allowEdit (allowEditCreateDS);
    retailMassUpdateWorksheetTable_ds.allowDelete (allowEditCreateDS);

    buttonGroup.enabled (
            (select firstonly RecId from RetailMassUpdateWorksheetLine
                where RetailMassUpdateWorksheetLine.RetailMassUpdateWorksheetTable == retailMassUpdateWorksheetTable.RecId).RecId
            && allowEditCreateDS);

    retailMassUpdateWorksheetLine_ds.allowEdit (allowEditCreateDS);
    retailMassUpdateWorksheetLine_ds.allowDelete (allowEditCreateDS);
    retailAddItems.enabled(retailMassUpdateWorksheetTable.RecId && allowEditCreateDS);
    pasteFirstRow.enabled(retailMassUpdateWorksheetTable.RecId && allowEditCreateDS);

    previousWorksheetFields = worksheetFields;
    previousTableAndFieldNum = tableAndFieldNum;

    this.visibleFalseForPreviousRecord();

    worksheetFields = new Set(Types::Integer);
    tableAndFieldNum = conNull();

    while select RecId from selected
        join SourceFieldNum, DestinationTableNum, DestinationFieldNum  from property
        where selected.RetailMassUpdateWorksheetTable == RetailMassUpdateWorksheetTable.RecId &&
        selected.RetailMassUpdateProductProperty == property.RecId
        join Name from fastTab
        where fastTab.RecId == property.FastTabRecID
    {
        origFieldId = int642int(property.DestinationFieldNum);
        tableAndFieldNum += [[property.DestinationTableNum, origFieldId, fastTab.Name]];
        destinationTableNum = int642int(property.DestinationTableNum);

        switch (destinationTableNum)
        {
            case tableNum(InventTableModule):
                if ( fastTab.Name == "@SYS53872")//Purchase
                {
                    Purch_ds.object(origFieldId).visible(true);
                }
                else if ( fastTab.Name == "@SYS300192")//Manage costs
                {
                    Invent_ds.object(origFieldId).visible(true);
                }
                else if ( fastTab.Name == "@SYS114644")//Sell
                {
                    Sales_ds.object(origFieldId).visible(true);
                }
                else if ( fastTab.Name == "@SYS118394")//Manage inventory
                {
                    Invent_ds.object(origFieldId).visible(true);
                }
                break;
            case tableNum(InventItemLocation):
                InventItemLocation_ds.object(origFieldId).visible(true);
                break;

            case tableNum(InventItemGroupItem):
                InventItemGroupItem_ds.object(origFieldId).visible(true);
                break;

            case tableNum(InventModelGroupItem):
                InventModelGroupItem_ds.object(origFieldId).visible(true);
                break;

            case tableNum(RetailInventTable):
                RetailInventTable_ds.object(origFieldId).visible(true);
                break;

            case tableNum(EcoResProductTranslation):
                EcoResProductTranslation_ds.object(origFieldId).visible(true);
                break;

            case tableNum(InventTable):
                InventTable_ds.object(origFieldId).visible(true);
                break;

            case tableNum(WHSInventTable):
                WHSInventTable_ds.object(origFieldId).visible(true);
                break;
        }
        id = int642int(property.SourceFieldNum);
        worksheetFields.add(id);
        RetailMassUpdateWorksheetLine_ds.object(id).visible(true);
    }

    if (previousWorksheetFields)
    {
        // Turn off previous fields that are not in the current field list.
        se = previousWorksheetFields.getEnumerator();
        while (se.moveNext())
        {
            id = se.current();
            if ((!worksheetFields.in(id)))
            {
                RetailMassUpdateWorksheetLine_ds.object(id).visible(false);
            }
        }
    }
}

public void visibleFalseForPreviousRecord()
{
    int                                 i;
    int                                 previousTableNumber;
    FieldId                             previousFieldNumber;
    Name                                previousFastTabName;
    container                           tmpPreviousContainer;

    if (previousTableAndFieldNum)
    {
        for (i=1; i <= conLen(previousTableAndFieldNum); i++)
        {
            tmpPreviousContainer = conPeek(previousTableAndFieldNum, i);
            previousTableNumber  = conPeek(tmpPreviousContainer, 1);
            previousFieldNumber  = conPeek(tmpPreviousContainer, 2);
            previousFastTabName  = conPeek(tmpPreviousContainer, 3);

            switch (previousTableNumber)
            {
                case tableNum(InventTableModule):
                    if ( previousFastTabName == "@SYS53872")//Purchase
                    {
                        Purch_ds.object(previousFieldNumber).visible(false);
                    }
                    else if ( previousFastTabName == "@SYS300192")//Manage costs
                    {
                        Invent_ds.object(previousFieldNumber).visible(false);
                    }
                    else if ( previousFastTabName == "@SYS114644")//Sell
                    {
                        Sales_ds.object(previousFieldNumber).visible(false);
                    }
                    else if ( previousFastTabName == "@SYS118394")//Manage inventory
                    {
                        Invent_ds.object(previousFieldNumber).visible(false);
                    }
                    break;
                case tableNum(InventItemLocation):
                    InventItemLocation_ds.object(previousFieldNumber).visible(false);
                    break;

                case tableNum(InventItemGroupItem):
                    InventItemGroupItem_ds.object(previousFieldNumber).visible(false);
                    break;

                case tableNum(InventModelGroupItem):
                    InventModelGroupItem_ds.object(previousFieldNumber).visible(false);
                    break;

                case tableNum(RetailInventTable):
                    RetailInventTable_ds.object(previousFieldNumber).visible(false);
                    break;

                case tableNum(EcoResProductTranslation):
                    EcoResProductTranslation_ds.object(previousFieldNumber).visible(false);
                    break;

                case tableNum(InventTable):
                    InventTable_ds.object(previousFieldNumber).visible(false);
                    break;

                case tableNum(WHSInventTable):
                    WHSInventTable_ds.object(previousFieldNumber).visible(false);
                    break;
            }
        }
    }
}

