void clicked()
{
    RetailMassUpdateUpdater updater;
    super();

    switch (RetailMassUpdateWorksheetTable.Status)
    {
        case RetailMassUpdateStatus::Open:
            info("@RET260005");
            break;
        case RetailMassUpdateStatus::Pending:
            info("@RET260006");
            break;
        case RetailMassUpdateStatus::Posted:
            info("@RET260007");
            break;
        case RetailMassUpdateStatus::Validated:

            RetailMassUpdateWorksheetTable.Status = RetailMassUpdateStatus::Pending;

            updater = RetailMassUpdateUpdater::construct(RetailMassUpdateWorksheetTable.RecId, RetailMassUpdateWorksheetTable_ds);

            if (updater.prompt())
            {
                updater.runOperation();
            }
            break;
    }
}

